import React from 'react';
import s from './Navbar.module.css';

function Navbar() {
    return (
        <nav>
            <span>Logo</span>
            <div className={s.left_nav}>
                <span>Home</span>
                <span>about me</span>
                <span>projects</span>
                <span></span>
            </div>
        </nav>
    );
}

export default Navbar;
